import React from 'react';

export default function Contact() {
  return (
    <div style={{ maxWidth: 700, margin: "2rem auto", padding: "2rem", background: "#fff", borderRadius: "1rem" }}>
      <h1>Contact Us</h1>
      <p>
        We love hearing from local families! If you have a suggestion, want to submit a new place, or just have a question, email us at: <br />
        <strong>directoryhub1989@gmail.com</strong>
      </p>
      <p>
        You can also use the “Suggest a Place” button on the homepage to send us your favorite activities.
      </p>
    </div>
  );
}
